itleComment Content'=>'Iruzkin edukia','This widget may have contained code that may work better in the &#8220;Custom HTML&#8221; widget. If you have not yet, how about trying that widget instead?'=>'Widget honek duen kodea hobeto ibil daiteke &#8220;HTML pertsonalizatua&#8221; widgetean. Oraindik egin ez baduzu, zergatik ez duzu honen ordez widget hori erabiltzen?','Your registration email is sent to this address. (Double-check your email address before continuing.)'=>'Izen emate e-posta helbide honetara bidaltzen dizugu. (Egiaztatu birritan zure e-posta helbidea jarraitu aurretik.)','This theme does not support video headers on this page. Navigate to the front page or another page that supports video headers.'=>'Itxura honek ez du bideo goibururik onartzen orrialde honetan. Nabigatu ezazu hasierako orrialdera edo bideo goiburuak onartzen dituen beste orrialde batera.','Invalid menu location.'=>'Menu kokaleku baliogabea.','Sorry, you are not allowed to view menu locations.'=>'Barkatu, ez duzu menu kokalekuak ikusteko baimenik.','You will not be able to install new themes from here yet since your install requires SFTP credentials. For now, please <a href="%s">add themes in the admin</a>.'=>'Ezin duzu hemendik itxura berririk instalatu zure instalazioak SFTP egiaztagiriak behar dituelako. Oraingoz, mesedez <a href="%s">gehitu itxurak administratzailetik</a>.','Cannot preview a widget that does not extend WP_Widget.'=>'Ezin da aurreikusi WP_Widget oinarri ez duten widgetik.','The password cannot be a space or all spaces.'=>'Pasahitza ezin da hutsunea izan edo dena hutsuneak izan.','No widget was found with that id.'=>'Ez da widgetik aurkitu id horrekin.','Get linked object.'=>'Lortu estekatutako objektua','Looks like this is not the correct kind of file. Please link to an audio file instead.'=>'Ez dirudi hau fitxategi mota egokia denik. Mesedez, estekatu audio fitxategi bat.','If you are not going to use a great site domain, leave it for a new user. Now have at it!'=>'Ez baduzu gune domeinu handi bat erabili behar, utz iezaiozu erabiltzaile berri bati. Orain, ekin!','Theme starter contentWelcome to your site! This is your homepage, which is what most visitors will see when they come to your site for the first time.'=>'Ongi etorri zure gunera! Zure hasierako orrialdea da hau, webgunera lehenengo aldiz datozenean bisitariek sarrien ikusiko dutena.','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by scanning the list of available widgets on this screen. Check it out to add some custom code to your site!'=>'Badakizu orain &#8220;HTML pertsonalizatua&#8221; widgeta dagoela? Pantaila honetan zerrendatzen diren widgetak begiratuz aurki dezakezu. Proba ezazu zure gunean pertsonalizatutako kodea gehitzeko!','Sorry, you cannot preview new themes when you have changes scheduled or saved as a draft. Please publish your changes, or wait until they publish to preview new themes.'=>'Barkatu, ezin dituzu itxurak berriak aurreikusi aldaketak programatuta edo zirriborro bezala gordeta daudenean. Mesedez argitaratu zure aldaketak edo itxaron besteek argitaratu arte itxura berriak aurreikusteko.','The menu cannot be deleted.'=>'Menua ezin da ezabatu.','Menus do not support trashing. Set \'%s\' to delete.'=>'Menuek ez dute zakarrontzira botatzerik onartzen. Ezarri \'%s\' ezabatzeko. ','Sorry, you are not allowed to view menus.'=>'Barkatu, ezin dituzu menuak ikusi.','Whether theme opts in to wide alignment CSS class.'=>'Ea itxurak lerrokatze zabaleko CSS klasea aukeratzen duen.','The provided instance is malformed.'=>'Emandako instantzia gaizki eratua dago.','Widget type (id_base) is required.'=>'(id_base) widget mota beharrezkoa da.','The provided widget type (id_base) cannot be updated.'=>'Emandako (id_base) widget mota ezin da eguneratu.','Cannot set instance on a widget that does not extend WP_Widget.'=>'Ezin da instantzia konfiguratu WP _Widget zabaltzen ez duen widget batean.','Widget type does not support raw i