ew media due to an unknown error.'=>'Ezin izan da media aurreikusi errore ezezagun baten ondorioz.','Unable to connect to the filesystem. Please confirm your credentials.'=>'Ezin izan da fitxategi-sistemarekin konektatu. Mesedez, berretsi zure egiaztagiriak.','Title of the global styles variation.'=>'Estilo globalen aldaketaren izenburua.','Title for the global styles variation, as it exists in the database.'=>'Estilo globalen aldaketaren izenburua., datu-basean dagoen bezala.','Title for the object, as it exists in the database.'=>'Objektuarentzat izenburua, datu-basean dagoen bezala.','Content for the template, as it exists in the database.'=>'Txantiloiarentzat edukia, datu-basean dagoen bezala.','Sorry, you are not allowed to access the global styles on this site.'=>'Barkatu, ezin dituzu gune honetako estilo globalak atzitu.','Sorry, you are not allowed to access the templates on this site.'=>'Barkatu, ezin dituzu gune honetako txantiloiak atzitu.','Menu items do not support trashing. Set \'%s\' to delete.'=>'Menuko elementuek ez dute zakarrontzira botatzerik onartzen. Ezarri \'%s\' ezabatzeko. ','The title is required when using a custom menu item type.'=>'Izenburua beharrezkoa da pertsonalizatutako menu-elementu mota bat erabiltzean.','The url is required when using a custom menu item type.'=>'URLa beharrezkoa da pertsonalizatutako menu-elementu mota bat erabiltzean.','HTML title for the object, transformed for display.'=>'HTML titulua objektuarentzat, erakusteko eraldatua.','The type of object originally represented, such as "category", "post", or "attachment".'=>'Jatorrian "kategoria", "bidalketa" edo "eranskin" gisa irudikatutako objektu mota.','The target attribute of the link element for this menu item.'=>'Menuko elementu honetarako lotura-elementuaren helburu-atributua.','The URL to which this menu item points.'=>'Menu-elementu hau erakusten duen URLa.','The XFN relationship expressed in the link of this menu item.'=>'Menu-elementu honen estekan adierazitako XFN erlazioa.','The terms assigned to the object in the %s taxonomy.'=>'%s taxonomian objektuari esleitutako terminoak.','Whether to automatically add top level pages to this menu.'=>'Ea menu honi lehen mailako orrialdeak automatikoki gehitzen dizkiozun.','The visibility settings for the post type.'=>'Bidalketa motaren ikusgarritasun ezarpenak.','Whether to generate a default UI for managing this post type.'=>'Ea erabiltzaile-interfaze lehenetsia sortu behar den bidalketa mota hau kudeatzeko.','REST namespace route for the taxonomy.'=>'Taxonomiaren REST bidearen izen-eremua.','REST route\'s namespace for the post type.'=>'Bidalketa motaren REST bidearen izen-eremua.','Limit to the specified template part area.'=>'Mugatu zehaztutako txantiloi-eremuaren zatira.','Post type to get the templates for.'=>'Berarentzat txantiloiak lortzeko bidalketa mota.','Source of a customized template'=>'Pertsonalizatutako txantiloiaren iturria','Version of the content block format used by the template.'=>'Txantiloiak erabilitako eduki-blokearen formatuaren bertsioa.','HTML title for the template, transformed for display.'=>'Txantiloiaren HTML izenburua, bistaratzeko eraldatua.','Whether a template is a custom template.'=>'Ea txantiloia pertsonalizatutako txantiloi bat den.','Where the template part is intended for use (header, footer, etc.)'=>'Txantiloi-zatia non erabili nahi den (goiburua, orri-oina, etab.)','The contents of the %s element from the URL.'=>'URLaren %s elementuaren edukiak.','The favicon image link of the %s element from the URL.'=>'URLaren %s elementuaren favicon irudi-esteka.','Whether to make the taxonomy available for selection in navigation menus.'=>'Ea taxonomia nabigazio-menuetan hautatzeko eskuragarri badagoen.','Whether to make the post type available for selection in navigation menus.'=>'Ea bidalketa mota nabigazio-menuetan hautatzeko eskuragarri dagoen.','The content of the %s element from the URL.'=>'URLaren %s elementuaren edukia.','The Open Graph image