egories.'=>'Menuaren elementu hau irudikatzen duen jatorrizko objektuaren datu-basearen identifikatzailea. Adibidez, bidalketentzat Identifikatzailea edo kategorientzat term_id-a.','Whether the menu item represents an object that no longer exists.'=>'Ea menu-elementuak jada ez dagoen objektu bat irudikatzen duen.','HTML representation of the widget admin form.'=>'Administratzaile inprimakiaren widgetaren HTML irudikapena.','Limit results to those matching a string.'=>'Mugatu emaitzak testu-kate batekin bat datozenetara.','Limit results to items of an object type.'=>'Mugatu emaitzak objektu mota bateko elementuetara.','Limit results to items of one or more object subtypes.'=>'Mugatu emaitzak objektu azpimota bat edo gehiagotara.','Limit results to those matching a pattern (slug).'=>'Mugatu emaitzak eredu (slug) batekin bat datozenetara.','The name of the menu location.'=>'Menuaren kokalekuaren izena.','The description of the menu location.'=>'Menuaren kokalekuaren deskribapena.','Ancestor blocks.'=>'Antzinako blokeak.','Unable to pass %s if not using multisite.'=>'Ezin da %s pasa gune-anitza erabiltzen ez baduzu.','Sorry, the video at the supplied URL cannot be loaded. Please check that the URL is for a supported video file (%s) or stream (e.g. YouTube and Vimeo).'=>'Barkatu, ezin dugu emandako URLko bideoa kargatu. Mesedez, egiaztatu URLa (%s) bideo fitxategi edo streaming (adibidez, YouTube eta Vimeo) bateragarri bati dagokiola.','That file cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'Ezin dugu fitxategi hori aurkitu. Egiaztatu zure <a href="%s">media liburutegia</a> eta ziurtatu ez dagoela ezabatua.','Need more help? <a href="%1$s">Read the support article on %2$s</a>.'=>'Laguntza gehiago behar duzu? <a href="%1$s">Irakurri laguntza artikulua %2$s(e)n</a>.','Password reset is not allowed for this user'=>'Ezin da  erabiltzaile honentzat pasahitza berrezarri','A monthly archive of your site&#8217;s Posts.'=>'Zure sa