ileak’ honen ordez.','As a percentage of the image, the width to crop the image to. DEPRECATED: Use `modifiers` instead.'=>'Irudiaren ehuneko gisa, irudia moztu beharrako zabalera. ZAHARKITUA: Erabili `modifikatzaileak’ honen ordez.','As a percentage of the image, the height to crop the image to. DEPRECATED: Use `modifiers` instead.'=>'Irudiaren ehuneko gisa, irudia moztu beharrako garaiera. ZAHARKITUA: Erabili `modifikatzaileak’ honen ordez.','Event timestamp must be a valid Unix timestamp.'=>'Ekitaldien denbora-zigiluak UNIX denbora-zigilu baliagarri bat izan behar du.','A plugin prevented the event from being scheduled.'=>'Plugin batek ekitaldia programatzea eragotzi du.','A plugin disallowed this event.'=>'Plugin batek ekitaldi hau errefusatu du.','Event schedule does not exist.'=>'Programatutako ekitaldia ez da existitzen.','A plugin prevented the event from being rescheduled.'=>'Plugin batek ekitaldia berriro programatzea eragotzi du.','A plugin prevented the event from being unscheduled.'=>'Plugin batek ekitaldia desprogramatzea eragotzi du.','A plugin prevented the hook from being cleared.'=>'Plugin batek kakoa bakantzea eragotzi du.','The cron event list could not be saved.'=>'Cron ekitaldien zerrenda ezin izan da gorde.','It looks like the response did not come from this site.'=>'Badirudi erantzuna ez datorrela gune honetatik.','Each application name should be unique.'=>'Aplikazio-izen bakoitzak bakarra izan behar du.','No alignment'=>'Lerrokatzerik gabe','vertical table cell alignmentV Align'=>'Lerrokatze bertikala','horizontal table cell alignmentH Align'=>'Lerrokatze horizontala','Align left'=>'Lerrokatu ezkerrean','Align right'=>'Lerrokatu eskuinean','Align center'=>'Lerrokatu erdian','Post formatQuote'=>'Aipua','HTML tagPreformatted'=>'Aurreformateatutakoa','Partial render must echo the content or return the content string (or array), but not both.'=>'Prozesatze partzialak edukia edo edukiaren testu-katea (edo zerrenda) itzuli behar ditu, ez bihak