al WordPress documentation</a>.'=>'Baliabide hau zure web ostalariak hornitua da, eta zure gunerako espezifikoa da. Informazio gehiago nahi baduzu, begira ezazu <a href="%s" target="_blank"> WordPress-en dokumentazio ofizialean </a>.','The SSL certificate for the host could not be verified.'=>'Ostalariaren SSL ziurtagiria ezin izan da egiaztatu.','PHP\'s XML extension is not available. Please contact your hosting provider to enable PHP\'s XML extension.'=>'PHPren XML hedapena ez dago eskuragarri. Jarri kontaktuan ostatatze hornitzailearekin PHPren XML luzapena gaitzeko mesedez.','Are you sure you have typed the correct hostname?'=>'Ziur al zaude ostalari-izen egokia idatzi duzula?','Please contact your host for assistance with investigating this issue further.'=>'Mesedez, jarri harremanetan zure ostatatze hornitzailearekin arazo hau sakonkiago aztertzen lagun zaitzan.','This means that the contact with the database server at %s was lost. This could mean your host&#8217;s database server is down.'=>'%s dagoen datu-base zerbitzariarekin konexioa galdu dela esan nahi du honek. Zure ostalariaren datu-basea deskonektatuta egon daiteke.','This either means that the username and password information in your %1$s file is incorrect or that contact with the database server at %2$s could not be established. This could mean your host&#8217;s database server is down.'=>'%1$s fitxategian ezarritako erabiltzaile-izen eta pasahitza zuzenak ez direla edo %2$s-n dagoen datu-base zerbitzariarekin konektatu ezin dela esan nahi du. Zure ostalariaren datu-basea deskonektatuta egon daiteke.','You cannot use that email address to signup. There are problems with them blocking some emails from WordPress. Please use another email provider.'=>'Ezin duzu e-posta helbide hori erabili izen-emateko. Arazoak daude beraiekin eta WordPress-eko e-posta batzu  blokeatzen dabiltza. Mesedez erabili beste posta-hornitzaile bat.','Time to add some links! Click &#8220;%s&#8221; to start putting pages, categories, and custom links in your menu. Add as many things as you would like.'=>'Esteka batzuk gehitzeko unea da! Egin klik &#8220;%s&#8221; botoian  zure menuan orri, kategoria eta esteka pertsonalizatuak jartzen hasteko. Gehitu nahi adina gauza.','Select site icon'=>'Hautatu guneko ikonoa','File &#8220;%s&#8221; does not exist?'=>'&#8220;%s&#8221; fitxategia ez da existitzen?','There is a new version of %s available, but it does not work with your version of WordPress.'=>'%s itxuraren bertsio berri bat dago eskuragarri, baina ez dabil zure WordPress bertsioarekin.','There is a new version of %s available, but it does not work with your version of PHP.'=>'%s itxuraren bertsio berri bat dago eskuragarri, baina ez dabil zure PHP bertsioarekin.','Function %1$s was called with an argument that is <strong>deprecated</strong> since version %2$s! %3$s'=>'%1$s funtzioa %2$s bertsiotik aurrera <strong>zaharkituta</strong> dagoen argumentu batekin deitu da! %3$s','The called constructor method for %1$s class in %2$s is <strong>deprecated</strong> since version %3$s! Use %4$s instead.'=>'%2$s-an %1$s klaserako metodo eraikitzailea deritzona <strong>zaharkituta dago</strong> %3$s! bertsiotik! Erabili %4$s bere ordez.','The called constructor method for %1$s class is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'%1$s klaserako metodo eraikitzailea deritzona <strong>zaharkituta dago</strong> %2$s! bertsiotik! Erabili %3$s bere ordez.','Function %1$s was called <strong>incorrectly</strong>. %2$s %3$s'=>'%1$s funtzioa <strong>modu desegokian</strong> deitu da. %2$s %3$s','Hook %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'%1$s kakoa <strong>zaharkituta</strong> dago %2$s bertsiotik aurrera! Erabili %3$s bere ordez.','Function %1$s was called with an argument that is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'%1$s funtzioa %2$s bertsiotik aurrera <strong>zaharkituta</strong> dagoen eta alterna