e database server could be connected to (which means your username and password is okay) but the %s database could not be selected.'=>'Baliteke datu-base zerbitzaria konektatuta egotea (zure erabiltzaile-izena eta pasahitza ondo daudela e3san nahiko luke), baina ezin da %s datu-basea hautatu.','Briefly unavailable for scheduled maintenance. Check back in a minute.'=>'Eguneraketa bat egiten ari gara eta webgunea ez dago erabilgarri. Egiaztatu ezazu berriro beranduago.','This file is too big. Files must be less than %s KB in size.'=>'Fitxategia handiegia da. Fitxategiak %s KB baino txikiagoak izan behar dira.','Template archives'=>'Txantiloi-artxiboak','Template part archives'=>'Txantiloi zatien artxiboak','Page Archives'=>'Orrialdeen Artxiboak','Navigation Menu archives'=>'Nabigazio menuko artxiboak','Manage Archives'=>'Kudeatu Artxiboak','post type archive title prefixArchives:'=>'Artxiboak:','file type groupArchives'=>'Artxiboak','Archive <span class="count">(%s)</span>'=>'Artxiboa <span class="count">(%s)</span>' . "\0" . 'Artxiboak <span class="count">(%s)</span>','No archives to show.'=>'Ez dago artxiborik erakusteko.','Post Archives'=>'Bidalketen Artxiboak','Post Type Archive'=>'Bidalketa Motaren Artxiboa','(%s author archive, opens in a new tab)'=>'(%s egilearen artxiboa, erlaitz berri batean zabaltzen da)','Select Week'=>'Hautatu Astea','Justify'=>'Lerrokatu','Next Page'=>'Hurrengo Orrialdea','If your theme has multiple menus, giving them clear names will help you manage them.'=>'Zure itxurak hainbat menu izanez gero, beroiei izen argiak emateak kudeaketa erraztuko dizu.','Sorry, that site already exists!'=>'Gune hori lehendik ere badago!','The user is already active.'=>'Erabiltzailea dagoeneko aktibo dago.','This panel is used for managing navigation menus for content you have already published on your site. You can create menus and add items for existing content such as pages, posts, categories, tags, formats, or custom links.'=>'Panel hau gunean dagoeneko argitaratuta duzun edukian nabigazio-menuak kudeatzeko erabiltzen da. Menuak sortu eta existitzen den edukia (orrialdeak, sarrerak, kategoriak, etikitak, formatuak edo estekak) gehitu dezakezu bertara.','Duplicate comment detected; it looks as though you&#8217;ve already said that!'=>'Iruzkin bikoiztua antzeman da; badirudi dagoeneko hori bera esan duzula!','The site appears to be already uninitialized.'=>'Badirudi gunea inizializatu gabe dagoela oraindik.','The site appears to be already initialized.'=>'Gunea dagoeneko inizializatuta dagoela dirudi.','The site is already active.'=>'Gune hau dagoeneko aktibatuta dago.','A duplicate event already exists.'=>'Bikoiztutako ekitaldia dagoeneko existizen da.','That username is already activated.'=>'Erabiltzaile-izen hau dagoeneko aktibatuta dago.','That email address has already been used. Please check your inbox for an activation email. It will become available in a couple of days if you do nothing.'=>'E-posta helbide hori dagoeneko erabilita dago. Egiaztatu zure sarrera-ontzia aktibazio e-postarako. Ezer egiten ez baduzu, pare bat egunean eskuragarri egongo da.','Already Installed'=>'Dagoeneko Instalatuta','You appear to have already installed WordPress. To reinstall please clear your old database tables first.'=>'Badirudi WordPress dagoeneko instalatuta dagoela. Berriro ere instalatu nahi baduzu, lehenik ezabatu itzazu zure datu-baseko taula zaharrak.','<strong>Error:</strong> This email address is already registered. <a href="%s">Log in</a> with this address or choose another one.'=>'<strong>Errorea:</strong> E-posta helbide hau dagoeneko erregistratuta dago. <a href="%s">Saioa hasi</a> helbide honekin edo aukeratu beste bat.','%s is already customizing this site. Do you want to take over?'=>'%s dagoeneko gune hau pertsonalizatzen ari da. Kontrola hartu nahi duzu?','%s is already customizing this changeset. Do you want to take over?'=>'%s dagoeneko aldaketa-multzoa kustomizatzen dago. Horren gainean egin nahi duzu?'