 array of arrays. Non-array value detected for %2$s.'=>'%1$s REST APIa multzoen multzo bat izan beharko litzateke. Multzo bat ez den balio bat hauteman da %2$s-(r)entzat.','If you are the owner of this network please check that your host&#8217;s database server is running properly and all tables are error free.'=>'Zu bazara sare honen jabea, egiaztatu zure ostalariaren datu-basearen zerbitzaria ondo dabilela eta taula guztiak errorerik gabekoak direla.','<strong>Conflicting values for the constants %1$s and %2$s.</strong> The value of %2$s will be assumed to be your subdomain configuration setting.'=>'<strong>%1$s eta %2$s konstanteen balioak gatazkan daude.</strong> %2$s konstantearen balioa hartuko da zure azpidomeinuaren konfigurazio-ezarpen bezala.','*'=>'*','Logged in as %1$s. <a href="%2$s">Edit your profile</a>. <a href="%3$s">Log out?</a>'=>'Saioa hasita %1$s gisa. <a href="%2$s">Editatu zure profila</a>. <a href="%3$s">Saioa bukatu?</a>','%sX-Large'=>'%sX-Handia','%sX-Small'=>'%sX-Txikia','Some of the theme.json settings.spacing.spacingScale values are invalid'=>'theme.json fitxategiaren settings.spacing.spacingScale balio batzuk baliogabeak dira','Your %1$s file uses a dynamic value (%2$s) for the path at %3$s. However, the value at %3$s is also a dynamic value (pointing to %4$s) and pointing to another dynamic value is not supported. Please update %3$s to point directly to %4$s.'=>'Zure %1$s fitxategiak balio dinamiko bat (%2$s) erabiltzen du %3$s-ko bide-izenerako. Hala ere, %3$s-ko balioa balio dinamikoa da ere (%4$s-ra seinalatzen) eta beste balio dinamiko batera seinalatzea ez dago onartuta. Mesedez, eguneratu %3$s %4$s-ra zuzenean seinalatu dezan.','put your unique phrase here'=>'jarri zure esaldi bakarra hemen','There has been a critical error on this website. Please reach out to your site administrator, and inform them of this error for further assistance.'=>'Errore kritiko bat gertatu da webgune honetan. Mesedez, jarri harremanetan gunearen admini